import axios from "axios";
import {useSelector} from "react-redux";


export const setUsers = (URL, auth_token) => {
    return axios.get(URL, {headers: {'Authorization': `Token ${auth_token}`}})
        .then(
            response => response,
            error => {
                console.log(`AJAX ERROR ${ error }`)
            }
        )

}
